          <h4>Follow Us</h4>
        </div>
      </div>

      {/* Footer Text */}
      <div className="footer-text">
        <p>Â© 2025 Team RASPBerry. All rights reserved. Crafted by SE-07.</p>
      </div>
    </footer>
